    "# Are there any sales that have no associated payments? \n",
    "# If so, how many?\n",
    "\n",
    "null_sales<-sales_payments %>%\n",
    "  filter(is.na(amount_paid)) %>%\n",
    "  group_by(sale_id)%>%\n",
    "  summarise(sales_count=n())%>%\n",
    "   arrange(desc(sales_count))%>%\n",
    "  slice(1:5)\n",
    "print(null_sales)"
   ]
